import React from 'react'

const Index = () => {

    React.useEffect(()=>{
     fetch("https://api.spacexdata.com/v3/launches?limit=100")
           .then(res => res.json())
           .then(res => console.log('res', res))
    },[])
    return(
        <div>
            Hello
        </div>
    )
}

export default Index
